import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Search from "./Search";
import Img from "./Img";

function App() {
  return (
    <>
      <Header />
      <div className="container">
        <Img
          link={"https://picsum.photos/500/300"}
          alt={"EcoSunscreen-headimg"}
        />
        <br />
        <Search />
      </div>
      <Footer />
    </>
  );
}

export default App;
